import React from 'react'
import Styled from 'styled-components'
import {AiOutlineUser} from 'react-icons/ai'
import { IoMdAdd } from 'react-icons/io'
function Form(props) {
  return (
    
       <div>
          <div>
                <Step label="2">Do</Step>
                <AvatorSection>
                    <AvatorContainer>
                        <AvatorIcon/>
                        <p><AvatorBadge/></p>
                    </AvatorContainer>
                </AvatorSection>
                  
                   
                   
                
                
          

            
          </div>

          <button  onClick={props.onClose}>
                Next
          </button>
       </div>    

  
  )
}

export default Form
const Step= Styled(Step)`
`
const AvatorSection = Styled.div`
display:flex;
justify-content:space-between;
align-items:center;


`

const AvatorContainer = Styled.div`
width:60px;
height:60px;
background:#ccc;
border-radius:50%;
transform:translateX(26vw);
cursor: pointer;

p{
    width:26px;
    height:26px;
    background:darkred;
    border-radius:50%;
 
    transform:translate(38px,-20px);
    border: 2px solid #ccdcdc;
    
  
    
}

`
const AvatorIcon = Styled(AiOutlineUser)`
color:white;
transform:translate(15px,15px);
font-size:30px;

`
const AvatorBadge = Styled(IoMdAdd)`
font-weight:600;
font-size:20px;
color:white !important;
font-size:20px;

`
